@charset "UTF-8";

.i-content {
  display: flex;
  justify-content: space-between;
  align-items: center;
  border-top: 2upx solid #f4f4f4;
  width: 100%;
  height: 90upx;
}

.i-placard-remaining-num {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 60%;
}

.i-placard-remaining {
  font-size: 28upx;
  color: #5c5c5c;
}

.i-placard-num {
  font-size: 48upx;
  color: #fe7c13;
  font-weight: 600;
}

.i-placard-button-view {
  display: flex;
  justify-content: flex-end;
  align-items: center;
}

.i-placard-button {
  width: 200upx;
  font-size: 30upx;
}

.i-placard-button button {
  color: #fe7c13;
  background-color: #fff;
  border-left: 2upx solid #f4f4f4;
}

.i-placard-active button{
  color: #fff;
  background-color: #fe7c13;
  border-left: 2upx solid #f4f4f4;
}

.btn {
  border: none;
  border-radius: 0;
}

.btn:after {
  border: none;
  border-radius: 0;
}
